import React from "react";
import MasonryItem from "./MasonryItem";

const MasonryColumn = () => {
  const ChangeStyle = e => {
    console.log((e.currentTarget.style.flex = "2"));
  };
  return (
    <div onClick={ChangeStyle} className='masonry-col'>
      <MasonryItem />
      <MasonryItem />
      <MasonryItem />
    </div>
  );
};

export default MasonryColumn;
